('7','1','1','Airfryer','Szukasz frytkownicy powietrznej lub akcesoriów do niej w atrakcyjnej cenie? Tutaj znajdziesz duży wybór frytownic powietrznych dla małych i dużych rodzin od najlepszych producentów, takich jak Philips, OBH Nordica, Russell Hobbs, Cosori, Princess, Ninja i nie tylko. Zapoznaj się z naszą ofertą lub przeczytaj więcej o tym, jak korzystać z frytkownicy powietrznej poniżej.','airfryer',NULL,NULL,NULL),
('8','1','1','Akcesoria do czyszczenia','Kiedy Twój dom wymaga czyszczenia, dobrze jest mieć odpowiedni sprzęt. Na proshop.pl znajdziesz przedmioty do sprzątania zarówno do użytku wewnątrz jak i na zewnątrz. Posiadamy również szeroką gamę urządzeń, które usuwają pot z czoła i ułatwiają czyszczenie.Jeśli czyszczenie odbywa się w pomieszczeniu, odkurzacz może usuwać kurz z podłogi i drzwi. Jeśli nie chcesz zwykłego odkurzacza podłogowego, dostępne są również odkurzacze ręczne. Są one nieco mniejsze i zapewniają większą elastyczność, ponieważ często są zasilane z baterii. Jeśli potrzebujesz umyć podłogi lub odkurzyć półki, mamy również odpowiedni sprzęt do tych zadań.Jeśli chcesz czyścić na zewnątrz, możesz zajść daleko z pomocą myjki wysokociśnieniowej lub myjki do patio. Jeśli okna uległy zabrudzeniu, zasilana akumulatorowo myjka do okien może znacznie ułatwić pracę.','akcesoria-do-czyszczenia',NULL,NULL,NULL),
('9','1','1','Akcesoria kuchenne','Akcesoria kuchenne mogą sprawić, że nasza kuchnia będzie jeszcze bardziej funkcjonalna, a my będziemy korzystać z niej z przyjemnością. Posegregowane przyrządy kuchenne, szafki uzupełnione produktami w opisanych i łatwo dostępnych pojemnikach oraz jedzenie w lodówce spakowane w plastikowe pudełka. Akcesoria umożliwią znalezienie w szybszym czasie tego, czego aktualnie potrzebujemy, a zwykłe przyprawy, sos oraz woda zostaną podane na stół z klasą. ','akcesoria-kuchenne',NULL,NULL,NULL),
('10','1','1','Czajnik elektryczny','Czajnik elektryczny jest najpopularniejszym małym AGD występującym w kuchni, w każdym gospodarstwie domowym. Zamiast podgrzewać wodę w garnku, czajnik elektryczny doprowadza wodę do wrzenia znacznie szybciej, a tym samym bardziej energooszczędnie. W mgnieniu oka możesz przygotować wodę na herbatę lub kawę.','czajnik-elektryczny',NULL,NULL,NULL),
('11','1','1','Dekoracje','Kochasz dom, projektowanie wnętrz i wystroju? A może po prostu szukasz konkretnych dodatków do domu? Tak czy inaczej, postaramy się zainspirować Cię i podrzucić nowe pomysły do Twojego wnętrza.','dekoracje',NULL,NULL,NULL),
('12','1','1','Frytkownica','Złociste frytki, idealnie zasmażone placki ziemniaczane, krążki cebulowe – to wszystko możesz osiągnąć dzięki frytkownicy. Dobra frytkownica pozwala nam na usmażenie w domowym zaciszu dań, które muszą zostać poddane obróbce termicznej. Na rynku dostępnych jest wiele frytkownic, od tych tradycyjnych, gdzie smażenie odbywa się w głębokim oleju, aż do tych bardzo „zdrowych”, czyli modeli, które zużywają wyłącznie jedną łyżkę oleju lub wcale.','frytkownica',NULL,NULL,NULL),
('13','1','1','Gofrownica','W okolicach Bożego Narodzenia nie ma nic tak pysznego, jak domowe gofry. Dżem, zwykły cukier lub cukier puder, wszystko pasuje do gorących gofrów. Gofry są łatwe do dzielenia się i smakują niesamowicie!Podobnie jak w przypadku naleśników, możemy je również jeść z lodami. Z urządzeniem do lodów z łatwością zrobisz własne domowe lody na gorące gofry. Wraz z deserem można rozkoszować się pyszną kawą parzoną na ziarnach lub kawowych kapsułkach. Posiadamy szeroki asortyment tanich gofrownic w wysokiej jakości.','gofrownica',NULL,NULL,NULL),
('14','1','1','Grill stołowy','Kiedy tylko pojawiają się pierwsze ciepłe dni po zimie jedyne, o czym myślimy to sezon grillowy. Ale czy nie byłoby miło mieć możliwość jedzenia pysznych dań z grilla w środku zimy?','grill-stolowy',NULL,NULL,NULL),
('15','1','1','Krajalnica','Jeśli chcesz pociąć wędliny do zamrożenia lub po prostu chcesz zrobić własny pyszny talerz wędlin, spodoba Ci się krajalnica do wędlin. Wiele osób kroi jedynie mięso na krajalnicy. Wiedziałeś, że można używać jej również do chleba, sera i warzyw? To sprawia, że jest bardzo wszechstronna. Dzięki temu proces krojenia jest znacznie szybszy i dokładniejszy niż w przypadku cięcia ręcznego.Większość modeli wyposażona jest w nóż ze stali nierdzewnej, który można dopasować do różnych grubości, dzięki czemu osiągniesz dokładnie taki rezultat, jakiego zapragniesz. Dla Twojego bezpieczeństwa wszystkie modele wyposażone są również w osłonę na nóż, tak aby uniemożliwić ukrojenie niewłaściwych rzeczy.Niektóre modele można złożyć, co ułatwia ich przechowywanie w szafce z tosterem i jajowarem.','krajalnica',NULL,NULL,NULL),
('16','1','1','Kuchenka mikrofalowa, mini piekarnik','Kuchenki mikrofalowe stają się coraz bardziej funkcjonalne. Kuchenki mikrofalowe mogą być używane do rozmrażania, podgrzewania i gotowania potraw. Można również otrzymać kuchenki mikrofalowe z funkcją grilla lub kuchenki mikrofalowe z grillem i konwekcją, które mają wszystkie zalety konwencjonalnych pieców. Łącząc mikrofale z konwekcją można znacznie skrócić czas gotowania.Mikrofalówki można dostać jako wolnostojące lub wbudowane od producentów takich jak Samsung, Electrolux, Whirlpool i Bosch. Mikrofalówki i mini piekarniki są dostępne w różnych rozmiarach od około 17 do 32 litrów. Ważne jest, abyś znał swoje potrzeby, wielkość naczyń i tym podobne, aby zostały zaspokojone przez wybraną kuchenkę mikrofalową.','kuchenka-mikrofalowa-mini-piekarnik',NULL,NULL,NULL),
('17','1','1','Maszyna kuchenna - akcesoria','Po zakupie dobrego urządzenia kuchennego warto zainwestować w niektóre akcesoria. Istnieją prawie niekończące się opcje i można znaleźć wiele ciekawych nowych opcji bez opróżniania konta bankowego. Jeśli wybrałeś urządzenie kuchenne z mocnym silnikiem, nie będziesz miał żadnych problemów, bez względu na to, czy chcesz zrobić domowe mięso mielone, czy zmiażdżyć lód na drinki.Dzięki akcesoriom do urządzenia kuchennego nie musisz inwestować w inne maszyny kuchenne ani w inne urządzenia kuchenne w swojej kuchni. Możesz zrobić makaron, posiekać warzywa na sałatkę, zrobić sok, zmiksować smoothie lub zrobić lody i sorbet.','maszyna-kuchenna-akcesoria',NULL,NULL,NULL),
('18','1','1','Mikser ręczny','W kuchni niezbędny jest mikser ręczny, bez względu na to, czy chcesz ubić śmietanę, zrobić ciasto na bułeczki, czy użyć go do gotowania. Prawie wszystkie modele wyposażone są w końcówki do ubijania i mieszania ciast.Aby dowiedzieć się, jaką moc ma silnik w mikserze ręcznym, należy sprawdzić, w ile Watt (W) jest wyposażony. Na przykład potężny silnik jest dobry, jeśli chcesz pracować z ciężkimi rzeczami, takimi jak ciasta lub ciastka. Oprócz mocniejszego silnika w nieco droższych modelach, otrzymujesz także więcej akcesoriów. Niektóre modele są również wyposażone w siekaczkę do cebuli i kubek miarowy.','mikser-reczny',NULL,NULL,NULL),
('19','1','1','Mycie okien - akcesoria','Jeśli jesteś zmęczony smugami podczas mycia okien, zastanów się nad zakupem myjki do okien, która zasysa brudną wodę. Posiadamy szeroką gamę myjek do okien takich marek jak Kärcher, Nilfisk i Dirt Devil.Ponadto mamy również wybór akcesoriów do mycia szyb takich jak mydła, ściągaczki i szmaty, dzięki czemu możesz je wymienić, gdy się zużyją.  W Proshop oferujemy również szereg innych produktów do utrzymania domu i ogrodu w czystości, m.in. kosiarki, podkaszarki do trawy, akcesoria do podlewania ogrodu, myjki wysokociśnieniowe i nożyce do żywopłotu.','mycie-okien-akcesoria',NULL,NULL,NULL),
('20','1','1','Odkurzacz - worki i akcesoria','Kiedy worek odkurzacza jest pełen, dobrze jest po prostu chwycić nowy z szafy i do niego włożyć. Filtr HEPA również powinien być świeży, wtedy zawsze podczas odkurzania uzyskasz bezpyłkowy wynik, przydatny, kiedy masz alergię. Jeśli potrzebujesz akcesoria lub części zamienne, zawsze możesz je znaleźć w Proshop.Jeśli szukasz taniego zwykłego odkurzacza, warto kupić model z workiem. Odkurzacze bezworkowe obecnie stały się prawie tak samo dobre, jak odkurzacze z workiem. Jednak w tańszych modelach z workiem nadal możesz odczuć pozytywną różnicę w ssaniu. W przypadku obu modeli posiadamy akcesoria, takie jak głowice, części zamienne itp.Jeśli masz odkurzacz ręczny lub robot odkurzacz, nie musisz kupować specjalnych worków. Jednak jeżeli w takim modelu bezprzewodowym przestanie działać bateria, zawsze możesz znaleźć nową w Proshop, i unikniesz tym samym wymiany całego urządzenia. Dla robotów odkurzaczy mamy również taśmę magnetyczną i wirtualną ścianę, pozwalającą kontrolować miejsce, w którym robot odkurza. ','odkurzacz-worki-i-akcesoria',NULL,NULL,NULL),
('21','1','1','Odkurzacz piorący',' ','odkurzacz-pioracy',NULL,NULL,NULL),
('22','1','1','Odkurzacz ręczny','Odkurzacz ręczny jest bardzo dobrym rozwiązaniem dla osób, które potrzebują szybko i łatwo odkurzyć niewielkie pomieszczenia, mieszkania, a nawet auta. Ręczne odkurzacze to alternatywa dla zwykłych odkurzaczy domowych, jednak potrafią być one dużo bardziej wygodne w użytkowaniu. Często ręczne odkurzacze są nazywane odkurzaczami pionowymi z racji swojej budowy lub odkurzaczami bezprzewodowymi. Najpopularniejsze odkurzacze ręczne produkują takie marki, jak: Dyson, Philips, Bosch, czy AEG. ','odkurzacz-reczny',NULL,NULL,NULL),
('23','1','1','Opiekacz do kanapek','Przepis na dobry tost jest tak prosty, że nawet najmłodsi w rodzinie mogą go zrobić. Oznacza to, że większość dzieci i młodzieży lubi gorące przekąski.','opiekacz-do-kanapek',NULL,NULL,NULL),
('24','1','1','Akcesoria do biura','Biuro jest miejscem dla pracy i hobby, które wymaga skupienia i ciszy. Inne pomieszczenia czasem nie oferują takich warunków. Centralnym elementem biura jest biurko, a to nie tylko stół ze stosem papierów, ale zorganizowane miejsce pracy, z którego można spokojnie wykonywać swoje obowiązki.','akcesoria-do-biura',NULL,NULL,NULL),
('25','1','1','Archiwizacja i przechowywanie','Potrzebujesz uporządkować dokumenty w domu lub w biurze? Tutaj znajdziesz mnóstwo pudełek do przechowywania z pokrywkami, pudełek do przechowywania dokumentów, pudełek archiwalnych i pudełka na czasopisma.','archiwizacja-i-przechowywanie',NULL,NULL,NULL),
('26','1','1','Drukarka etykiet','W naszym szerokim asortymencie znajdziesz najlepsze drukarki do etykiet i drukarki termiczne. Kup maszynę etykietującą, która wykonuje proste paski np. na identyfikatory lub zaawansowaną drukarkę do specjalnie zaprojektowanych etykiet np. z obrazkami, do kodów kreskowych i drukowania logo. ','drukarka-etykiet',NULL,NULL,NULL),
('27','1','1','Ergonomia','Wygoda w miejscu pracy zapewnia lepsze samopoczucie i zwiększa wydajność pracy. Sprawdź naszą ofertę produktów ergonomicznych do zastosowań biurowych i zainwestuj w lepszą ergonomię, a zapewni to jeszcze więcej zysków.','ergonomia',NULL,NULL,NULL),
('28','1','1','Kalendarz','Kalendarz','kalendarz',NULL,NULL,NULL),
('29','1','1','Kalkulator','Tutaj znajdziesz duży wybór najlepszych kalkulatorów w niskiej cenie.Jeśli się uczysz lub wykonujesz w pracy wiele obliczeń, dobrze jest mieć pod ręką kalkulator. Wiele osób wykonuje dzisiaj obliczenia na laptopie lub komputerze stacjonarnym, ale to kalkulator jest zawsze niezawodny i łatwy do zabrania ze sobą.','kalkulator',NULL,NULL,NULL),
('30','1','1','Kasy','Dobra kasa fiskalna jest koniecznością w większości sklepów fizycznych w wielu różnych branżach, niezależnie od tego, czy chodzi o sklep, kawiarnię, restaurację, sklep odzieżowy czy mały sklep spożywczy. Możliwości jest wiele dzięki prostemu i inteligentnemu rejestrowi, który może zaspokoić Twoje potrzeby.','kasy',NULL,NULL,NULL),
('31','1','1','Kontrola czasu i obecności','Kontrola czasu i obecności','kontrola-czasu-i-obecnosci',NULL,NULL,NULL),
('32','1','1','Koperty & Kartony','Koperty &amp; Kartony','koperty-kartony',NULL,NULL,NULL),
('33','1','1','Koszulki, ofertówki i przekładki','Posiadasz dużo dokumentów i papierów w nieładzie? Uporządkuj je dzięki koszulkom i przekładkom, które idealnie nadają się do segregatorów i pojemników. W Proshop znajdziesz wiele wysokiej jakości plastikowych koszulek, przekładek, pokrowców na dokumenty i do zapisów do archiwizacji dokumentów.','koszulki-ofertowki-i-przekladki',NULL,NULL,NULL),
('34','1','1','Materiały do pakowania','Materiały do pakowania','materialy-do-pakowania',NULL,NULL,NULL),
('35','1','1','Papier, papier fotograficzny i etykiety','W Proshop znajdziesz szeroki wybór papieru do drukowania o różnych rozmiarach i grubościach. Papier do drukarki jest niezbędnikiem w wielu biurach, ale również do użytku domowego czy też drukowania zdjęć.','papier-papier-fotograficzny-i-etykiety',NULL,NULL,NULL),
('36','1','1','Przędza i akcesoria','Przędza i akcesoria','przedza-i-akcesoria',NULL,NULL,NULL),
('37','1','1','Przybory szkolne','Przybory szkolne','przybory-szkolne',NULL,NULL,NULL),
('38','1','1','Teczka i deska z klipsem','Teczka i deska z klipsem','teczka-i-deska-z-klipsem',NULL,NULL,NULL),
('39','1','1','Zeszyty, notesy i formularze','Dla niektórych osób notatnik jest ważnym narzędziem roboczym i dobrym małym towarzyszem, który można wykorzystać do przechowywania zarówno drobnych notatek, jak i ważnych informacji. W naszej sprzedaży znajdziesz szeroki wybór notatników i zeszytów w wielu wzorach i kolorach.','zeszyty-notesy-i-formularze',NULL,NULL,NULL),
('40','1','1','Znaki i karty','Znaki i karty','znaki-i-karty',NULL,NULL,NULL),
('41','1','1','Akcesoria do czyszczenia','Kiedy Twój dom wymaga czyszczenia, dobrze jest mieć odpowiedni sprzęt. Na proshop.pl znajdziesz przedmioty do sprzątania zarówno do użytku wewnątrz jak i na zewnątrz. Posiadamy również szeroką gamę urządzeń, które usuwają pot z czoła i ułatwiają czyszczenie.Jeśli czyszczenie odbywa się w pomieszczeniu, odkurzacz może usuwać kurz z podłogi i drzwi. Jeśli nie chcesz zwykłego odkurzacza podłogowego, dostępne są również odkurzacze ręczne. Są one nieco mniejsze i zapewniają większą elastyczność, ponieważ często są zasilane z baterii. Jeśli potrzebujesz umyć podłogi lub odkurzyć półki, mamy również odpowiedni sprzęt do tych zadań.Jeśli chcesz czyścić na zewnątrz, możesz zajść daleko z pomocą myjki wysokociśnieniowej lub myjki do patio. Jeśli okna uległy zabrudzeniu, zasilana akumulatorowo myjka do okien może znacznie ułatwić pracę.','akcesoria-do-czyszczenia',NULL,NULL,NULL),
