('44','1','1','Hulajnoga elektryczna','Hulajnoga elektryczna to jeden z najwygodniejszych sposób na przemieszczanie się z punktu A do punktu B bez zbędnego stresu i czasu oczekiwania na transport publiczny, dodatkowo nie wiąże się to z poszukiwaniem parkingu i opłatami z nim związanymi.','hulajnoga-elektryczna',NULL,NULL,NULL),
('45','1','1','Kosa spalinowa','Kosa spalinowa','kosa-spalinowa',NULL,NULL,NULL),
('46','1','1','Łuparki do drewna','Drewno możesz siekać siekierą, jednak zadanie to jest znacznie łatwiejsze przy użyciu rozłupywarki, jeśli potrzebujesz drewna ciętego na więcej, niż tylko małe ognisko ogrodowe.','luparki-do-drewna',NULL,NULL,NULL),
