('49','1','1','Mycie okien - akcesoria','Jeśli jesteś zmęczony smugami podczas mycia okien, zastanów się nad zakupem myjki do okien, która zasysa brudną wodę. Posiadamy szeroką gamę myjek do okien takich marek jak Kärcher, Nilfisk i Dirt Devil.Ponadto mamy również wybór akcesoriów do mycia szyb takich jak mydła, ściągaczki i szmaty, dzięki czemu możesz je wymienić, gdy się zużyją.  W Proshop oferujemy również szereg innych produktów do utrzymania domu i ogrodu w czystości, m.in. kosiarki, podkaszarki do trawy, akcesoria do podlewania ogrodu, myjki wysokociśnieniowe i nożyce do żywopłotu.','mycie-okien-akcesoria',NULL,NULL,NULL),
('50','1','1','Myjka wysokociśnieniowa','Chociaż może być kuszące kupowanie nowych płytek, gdy taras jest pokryty glonami, często wystarczy go wyczyścić za pomocą myjki wysokociśnieniowej. Posiadamy szeroki asortyment myjek wysokociśnieniowych producentów takich jak Nilfisk i Kärcher w różnych przedziałach cenowych.Myjką wysokociśnieniową można czyścić również samochody i maszyny ogrodowe, takie jak kosiarki. Ważne jest, aby kupić odpowiednie akcesoria do myjki. Na przykład w Proshop znajdziesz mydła i szczotki do mycia samochodu lub środki do czyszczenia tarasów.','myjka-wysokocisnieniowa',NULL,NULL,NULL),
('51','1','1','Narzędzia','Jeśli musisz wywiercić dziurę w ścianie lub przeciąć kawałek drewna na pół, to denerwujące, że nie masz odpowiednich narzędzi. Mamy duży wybór różnych narzędzi, które powinny się znaleźć w Twoim domu. Nasza oferta jest pełna produktów od takich największych marek jak Bosch, Black and Decker, Dewalt, Makita, Fiskars, Gardena, Dremel, Kärcher and Einhell.Posiadamy regularne wiertarki elektryczne i wiertarki udarowe. Jeśli potrzebujesz coś przepiłować, mamy piły tarczowe, piły do metalu, piły szablaste i piły taśmowe. Jeśli chcesz odnowić stół mamy zwykłe szlifierki i szlifierki orbitalne. Różne typy narzędzi są dostępne w wersjach zasilanych baterią lub bezprzewodowo.Oprócz samych maszyn posiadamy do nich większość akcesoriów. Jeśli potrzebujesz nowych wierteł, brzeszczotów, pistoletów do kleju lub czegoś innego, to na pewno to mamy. Jeśli okaże się, że nie możesz znaleźć nowego  narzędzia lub jakiegoś z akcesoriów, którego potrzebujesz, to skontaktuj się z nami, na pewno ci pomożemy. ','narzedzia',NULL,NULL,NULL),
('52','1','1','Narzędzia ogrodowe','W przypadku każdego ogrodu konieczne jest posiadanie wysokiej jakości narzędzi ogrodowych, aby utrzymać ogród w dobrym stanie. Przedstawiamy zatem szeroką gamę różnych narzędzi ogrodowych, takich jak grabie, piły ogrodowe, nożyce ogrodowe, motyki i kultywatory.Posiadamy również szeroką gamę systemów nawadniania ogrodów i maszyn ogrodniczych, takich jak kosiarki do trawy, piły łańcuchowe i wykaszarki, dzięki czemu Twój ogród może być w doskonałym stanie.Życie jest za krótkie na stary i nieodpowiedni sprzęt.','narzedzia-ogrodowe',NULL,NULL,NULL),
('53','1','1','Narzędzia pomiarowe','Narzędzia pomiarowe','narzedzia-pomiarowe',NULL,NULL,NULL),
('54','1','1','Narzędzia wielofunkcyjne','Narzędzia wielofunkcyjne','narzedzia-wielofunkcyjne',NULL,NULL,NULL),
('55','1','1','Odśnieżarki','Czy jesteś zmęczony ręcznym odśnieżaniem w zimę? Na ## ConceptId ## znajdziesz szeroki wybór różnych odśnieżarek znanych marek, takich jak McCulloch. Pługi śnieżne wyposażone są w silnik, który zarówno odrzuca śnieg, jak i porusza się do przodu, więc nie musisz nic robić, tylko go sterować i cieszyć się jazdą. Odśnieżarka sprawdzi się zatem, jeśli masz większy obszar, który zostaje szybko pokryty śniegiem, na przykład duży podjazd lub chodnik.Szukając odśnieżarek, dobrym pomysłem jest znalezienie maszyny pasującej do szerokości chodnika. Wtedy cały chodnik zostanie oczyszczony za jednym zamachem.Znajdziesz także wiele innych rzeczy, które pozwolą Ci zachować porządek w ogrodzie na ## ConceptId ##. Zobacz na przykład naszą ofertę kosiarek, myjek wysokociśnieniowych i traktorów ogrodowych.','odsniezarki',NULL,NULL,NULL),
('56','1','1','Odzież robocza BHP i akcesoria','Wykonujesz prace ogrodowe, odnawiasz dom, czy po prostu chcesz być przygotowany w razie wypadku? Na Proshop mamy szeroką gamę sprzętu bezpieczeństwa i odzieży ochronnej od producentów, takich jak AL-KO, Bosch i Makita.Jeśli chcesz wyciąć drzewo za pomocą piły łańcuchowej, dobrze byłoby użyć hełmu ochronnego z przyłbicą, ochronników słuchu, butów ochronnych, rękawiczek, dobrej kurtki, jak i spodni. Te środki bezpieczeństwa są również niezbędne, gdy trzeba przyciąć żywopłot lub użyć kosy spalinowej.','odziez-robocza-bhp-i-akcesoria',NULL,NULL,NULL),
('57','1','1','Ogrzewacz ogrodowy','Ogrzewacz ogrodowy','ogrzewacz-ogrodowy',NULL,NULL,NULL),
('58','1','1','Opalarka','Tutaj znajdziesz szeroką gamę opalarek od takich producentów jak Bosch, Dewalt i Makita.  Opalarka jest skutecznym narzędziem i może zrobić znacznie więcej, niż tylko usunąć pozostałości kleju, farby lub oleju, a także odmrażać rury wodne. Na przykład możesz jej używać do zmiękczania plastiku lub PCV, dzięki czemu można go łatwo zginać i kształtować. Można jej użyć do woskowania nart lub snowboardu, a także do zapalania grilla.Kupując opalarkę, warto ją poszukać w regulowanej temperaturze. Oznacza to, że nie nagrzewa się stale, na przykład do 500 stopni. W związku z tym poszukaj takiej, którą można dostosować miedzy 300 i 600 stopni. Ponadto dobre jest to, aby dobra opalarka miała  moc co najmnie 1800 W, wtedy będzie skuteczna w wielu różnych zadaniach.','opalarka',NULL,NULL,NULL),
('59','1','1','Drukarka 3D','Drukarka 3D','drukarka-3d',NULL,NULL,NULL),
('60','1','1','Drukarka etykiet','W naszym szerokim asortymencie znajdziesz najlepsze drukarki do etykiet i drukarki termiczne. Kup maszynę etykietującą, która wykonuje proste paski np. na identyfikatory lub zaawansowaną drukarkę do specjalnie zaprojektowanych etykiet np. z obrazkami, do kodów kreskowych i drukowania logo. ','drukarka-etykiet',NULL,NULL,NULL),
('61','1','1','Drukarka wielkoformatowa','Drukarka wielkoformatowa','drukarka-wielkoformatowa',NULL,NULL,NULL),
('62','1','1','Filament - Drukarka 3D','Podobnie jak zwykła drukarka atramentowa, drukarka 3D również potrzebuje materiałów eksploatacyjnych, aby wydrukować pożądany produkt. Zamiast toneru lub pojemnika z tuszem, drukarka 3D wykorzystuje różne typy plastikowych włókien na rolkach lub cieczy żywicznej.Jako początkujący najłatwiej i najtaniej jest pracować z drukarką FFF/FDM. Dwa najczęściej używane materiały do drukowania to PLA i ABS. PLA jest mniej elastycznym materiałem niż ABS. Ze względu na niższą temperaturę topnienia, PLA nie wymaga płyty grzewczej i jest ogólnie łatwiejsza w obróbce niż ABS. Zaletą ABS jest większa elastyczność materiału i jego wytrzymałość.Wybierając filament do drukarki, ważne jest, aby zwrócić uwagę na następujące elementy. Czy Twoja drukarka obsługuje tylko oryginalne filamenty, czy również zamienniki? Jaką grubość żarnika zużywa twoja drukarka - 1.75mm? Ile gramów potrzebujesz i w jakich kolorach?Rolki filamentowe pochodzą od wielu różnych producentów. Możliwe jest uzyskanie zarówno oryginalnego filamentu, jak i zamienników. Niektóre drukarki obsługują tylko oryginalne szpule od producenta drukarki, ale coraz więcej drukarek obsługuje obecnie również zamienniki. Producenci tacy jak Verbatim, Prima i Inno3D produkują wysokiej jakości zamienniki. Jeśli drukarka obsługuje zamienniki, można również użyć oryginalnego filamentu z dowolnej innej marki.Jeśli potrzebujesz płynu żywicznego do drukarki SLA, na naszej stronie internetowej znajdziesz szeroki wybór. Drukarka SLA osiąga bardziej profesjonalny wynik niż drukarka FFF/FDM. Drukarka SLA używa lasera do utwardzania światłoczułej cieczy żywicznej i tworzenia przedmiotu w 3D. Kupując żywicę do drukarki 3D, warto kupić oryginalny płyn na bazie żywicy. Zapewnia to wyższą jakość druku i dłuższą żywotność drukarki SLA.Jeśli skończył Ci się filament do Twojego 3D-Pen, to dobrze trafiłeś. Filament do pióra, do drukowania 3D jest dostarczany w małych prętach umieszczonych na końcu długopisu. Istnieje możliwość zakupu zestawów żarników w różnych kolorach lub zestawach jednokolorowych.','filament-drukarka-3d',NULL,NULL,NULL),
('63','1','1','Papier, papier fotograficzny i etykiety','W Proshop znajdziesz szeroki wybór papieru do drukowania o różnych rozmiarach i grubościach. Papier do drukarki jest niezbędnikiem w wielu biurach, ale również do użytku domowego czy też drukowania zdjęć.','papier-papier-fotograficzny-i-etykiety',NULL,NULL,NULL),
('64','1','1','Skaner','Skaner','skaner',NULL,NULL,NULL),
('65','1','1','Tusz, toner i materiał eksploatacyjny','W proshop.pl mamy ogromny wybór wkładów atramentowych, a także tonerów do drukarek laserowych od dużych producentów, takich jak HP, Brother, Epson, Canon, Lexmark, OKI, Xerox, itp. Jednak mamy również duży wybór mniej powszechnie używanych marek. Możesz je łatwo znaleźć, wybierając producenta w filtrze poniżej.Oczywiście szeroki wybór może wywoływać u Ciebie pewne wątpliwości jako konsumenta. Dlatego stworzyliśmy przewodnik, dzięki któremu zawsze znajdziesz odpowiednie produkty do swojej drukarki. Przewodnik znajdziesz tutaj: https://www.proshop.eu/InkToner-Guide.htmXL i Duża WydajnośćBardzo duża część wszystkich tonerów i wkładów atramentowych jest dostępna zarówno w wersji standardowej, jak i wersji XL w nieco wyższej cenie. W przypadku atramentu jest on zwykle nazywany XL, natomiast termin \"High Capacity\" jest najczęściej używany w przypadku tonerów laserowych. Często będziesz w stanie zaoszczędzić dużo pieniędzy, wybierając większą wersję, ponieważ starcza ona dłużej. Przed zakupem większej wersji należy jednak pamiętać, że wkłady atramentowe mają datę ważności, dlatego należy rozważyć z jaką częstotliwością będziesz drukować i oszacować jak szybko nastąpi wyczepranie tuszu.Jeśli potrzebujesz ogólnych wskazówek lub masz pytania dotyczące konkretnego produktu, zawsze możesz skontaktować się z nami za pośrednictwem naszego czatu, e-maila lub telefonu.','tusz-toner-i-material-eksploatacyjny',NULL,NULL,NULL);
