('1','1','1','Philips AirFryer XXL zestaw mistrza pieczenia HD9956/00 pomaga w przygotowaniu słodkich i pikantnych przysmaków dla Twoich przyjaciół i rodziny. Jest wyposażony w powłokę nieprzywierającą, jest zmywalny w zmywarce i ma 9 silikonowych foremek do muffinek, dzięki czemu możesz łatwo rozpocząć.',NULL,'philips-baking-tray-accessory-xxl-hd9956-00',NULL,NULL,NULL,'Philips Baking tray accessory XXL HD9956/00',NULL,NULL,NULL,NULL),
