('41','1','1','• Szybkie i łatwe czyszczenie • Uzupełniacz do mopa na mokro (mop sprzedawany osobno) • Wilgotne ściereczki mopowe z pułapką detergentu zatrzymują brud w ściereczce • Potężny, unikalny środek czyszczący rozpuszcza brud z powierzchni i utrzymuje go • Przekręć głowicę Swiffera, aby usunąć uporczywe plamy za pomocą paska do szorowania • Świeży cytrusowy zapach• Doskonałe dla podłóg winylowych, ceramicznych i traktowanych drewnianych• Nie stosować wody na delikatnych nieobrobionych, olejowanych, woskowanych drewnianych podłogach ani na nieuszczelnionych kafelkach lub dywanach. Kto powiedział, że Swiffer to tylko suchy sprzątanie? Swiffer ma również ściereczki do mopowania na mokro o silnym rozpuszczaniu brudu usuwającego zabrudzenia ze wszystkich powierzchni. Zachowaj swoje podłogi czyste i pachnące dobrym środkiem czyszczącym rozpuszczającym uporczywe plamy oraz brud i uwięzionym go w materiale oddalonym od Twoich podłóg sprawiając sprzątanie domowych kafli lub linoleum dziecinnie proste. Gdy musisz usunąć uporczywe plamy, przekręć głowicę mopa i szoruj plamę zielonym paskiem do szorowania. Płaska głowica umożliwia dotarcie do miejsc, których nie można osiągnąć innymi środkami czyszczącymi (pod sofą, łóżkami, lodówką, zmywarka,...)! Tak więc Twój mop Swiffer stał się narzędziem 2 w 1: użyj go z suchym materiałem do zbierania kurzu i mokrym mopem do sprzątania! Mogą być również bezpiecznie stosowane na drewnianych podłogach. Nie stosować ściereczek Swiffer mop floor cloths na mokro przy czyszczeniu nieobrobionych drewnianych podłóg olejowanych lub woskowanych ani na nieuszczelnionych kafelkach lub dywanach.',NULL,'swiffer-wet-citrus-refill-24-pcs',NULL,NULL,NULL,'Swiffer Wet Citrus Refill 24 pcs',NULL,NULL,NULL,NULL),
