('179','1','1','Optigrill + z tacką na przekąski, 2000 watów, 6 automatycznych programów gotowania i funkcja manualna, pochyłe płyty grilla zapewniają odprowadzanie nadmiaru tłuszczu do tacki na kroplówki, dodatkowo duża tacka na kroplówki, wyjmowane płyty grilla z powłoką nieprzywierającą mogące wytrzymać mycie w zmywarce w zestawie ze stojakiem i blachami aluminiowymi do pieczenia i przekąsek. Dzięki OptiGrill łatwo uzyskać idealne wyniki grillowania - za każdym razem! Inteligentny grill stołowy jest wyposażony w czujnik wykrywający grubość jedzenia oraz czas i temperaturę gotowania są automatycznie dostosowywane. Wskaźnik pokazuje kolory stopnia ugotowania od miękkiego do dobrze wysmażonego, dzięki czemu możesz mieć swojego steka dokładnie tak jak lubisz.OptiGrill + ma 6 automatycznych programów gotowania dla różnych składników; burgery, drób, panini , kiełbaski , wołowina i ryby. Ma również ustawienia ręczne do grillowania warzyw oraz pieczenia.Jako coś zupełnie unikalnego ten OptiGrill ma wbudowaną formowaną tacę co sprawia że produkt jest jeszcze bardziej wszechstronny. Dzięki niej możesz przygotować np. ziemniaki puree, piec pizzę i ciasto lub podgrzać bułki na śniadanie - wszystko to co normalnie robisz w tradycyjnym piekarniku.Czyszczenie jest łatwe ponieważ płyty grilla i tacka mają powłokę nieprzywierającą, dzięki czemu nic się nie przypala. Są one wyjmowane i nadają się do mycia w zmywarce.',NULL,'obh-nordica-optigrill-go7148s0',NULL,NULL,NULL,'OBH Nordica Optigrill+ GO7148S0',NULL,NULL,NULL,NULL),
