('181','1','1','Elektryczny grill, 30 x 20 cm, 12 programów automatycznych, srebrno-czarnyOptiGrill Elite - domowy grill mistrz w idealnym grillowaniu mięsa. Grilluj zawsze skutecznie i zachwycaj swoich bliskich doskonałym efektem. Radzi sobie z mięsem na każdy sposób - od krwistego do dobrze wysmażonego. Dzięki swojej inteligencji Optigrill Elite potrafi zmierzyć grubość mięsa i uwzględnić ilość kawałków mięsa, aby automatycznie ustawić czas gotowania dla doskonałego efektu grilla. Otrzymaj wyniki jak w restauracji dzięki nowej funkcji ostrzenia na twoim mięsie. Odkryj nowe doświadczenie z grillem',NULL,'tefal-optigrill-elite-gc750d30',NULL,NULL,NULL,'Tefal Optigrill Elite GC750D30',NULL,NULL,NULL,NULL),
