('208','1','1','Ręczna maszyna do chleba i wędlin w stylu retro, Bezstopniowa regulacja do 0,7 cala, Drewniana podstawa zapewnia łatwe czyszczenie, 4 przyssawki pewnie utrzymują dysk na miejscu, Konstrukcja metalowa, Maksymalny rozmiar cięcia: 2 cm  Maszyna wykonana w zaktualizowanej wersji retro , który można złożyć, gdy nie jest używany, a tym samym mniej wypełnia szafkę. Wypiekacz do chleba jest wyposażony w antypoślizgowe nóżki, a ostrze jest klasycznej niemieckiej jakości z ostrym cięciem fali. Wypiekacz do chleba z korbą może szybko zamienić chleb, szynki, kiełbaski, bekon, warzywa - nawet krojenie sera - na drobne, jednolite kromki - bez użycia prądu, limitów CO2 i innych złych rzeczy. Ostrze można oczywiście zdemontować i ponownie ostrzyć, jeśli zajdzie taka potrzeba, a ostrze jest oczywiście łatwe do utrzymania w czystości.',NULL,'zassenhaus-krajalnica-bread-and-cold-cut-slicer',NULL,NULL,NULL,'Zassenhaus Krajalnica Bread- and cold cut slicer',NULL,NULL,NULL,NULL),
