('795','1','1','Xiaomi Portable Electric Air Compressor 1S to potężna i kompaktowa pompka do szybkiego i wydajnego pompowania opon. Zdolność do wypompowania dwóch opon samochodowych lub wykonania ośmiu uzupełnień na jednym ładowaniu, to aż 45,5% poprawy w stosunku do poprzednika - Mi Portable Electric Air Compressor oraz przepływ powietrza większy o 114%. Wybierz spośród pięciu ustawień i łatwiej niż kiedykolwiek uzupełniaj powietrze w samochodach, motocyklach, rowerach i piłkach. Ta przenośna pompka posiada blok cylindrów wysokiej precyzji osiągający ciśnienie 150 PSI już po 20 sekundach. Xiaomi Portable Electric Air Compressor 1S doskonale sprawdzi się zarówno przy górskich jak i szosowych rowerach z wysokociśnieniowymi oponami. Ta pompa działa na wbudowanych bateriach litowo-jonowych oraz może być ładowana za pomocą adaptera USB, powerbanka lub w samochodzie.Aby uprościć proces korzystania z urządzenia dostępne są pięć różnych trybów: tryb ręczny, tryb rowerowy, tryb motocyklowy, tryb samochodu oraz trybu piłki. Możliwe jest również dostosowanie każdego ustawienia dla określenia pożądanego ciśnienia, dzięki czemu uzyskanie idealnego wyniku jeszcze nigdy nie było takie łatwe. Na przykład tryb motocyklowy obejmuje zakres od 1,8-3,0 bara z domyślnym ustawieniem 2,4 bara. Ponieważ pompa jest lekka i stylowa, jej przenoszenie to prawdziwa przyjemność. Kup teraz i ułatw sobie życie!',NULL,'xiaomi-1s-portable-electric-air-compressor',NULL,NULL,NULL,'Xiaomi 1S Portable Electric Air Compressor',NULL,NULL,NULL,NULL),
