('801','1','1','Więcej mocy z maksymalnym wyjściem 300 W. Hulajnoga osiąga maksymalną prędkość do 20 km/h (co jest maksymalną prędkością legalną na drogach duńskich) i może poradzić sobie z jazdą po stokach o nachyleniu do 16%. Daj jej trochę gazu i jedź do pracy, na trening lub napij się kawy z przyjaciółmi.Gdy poziom baterii spadnie poniżej 30% i hulajnoga nie będzie włączona przez około 10 kolejnych dni, bateria przejdzie w tryb uśpienia, aby przedłużyć jej życie. Piąta generacja inteligentnego systemu zarządzania bateriami BMS zapewnia również, że Twoja bateria działa tak, jak powinna.Oprócz reflektora przedniego i diodowego ostrzegawczego światła tylnej lampy tylna hulajnoga ma także duży reflektor przedni oraz duże dwustronne odblaski boczne dla Twojego bezpieczeństwa oraz otoczenia. Nowe podwójne hamulce tarczowe zapewniają bardziej efektywne hamowanie z szybką reakcją oraz wydłużają trwałość klocków hamulcowych, co czyni jazdę bezpieczniejszą.Rama wykonana jest ze szczególnie trwałego stopu aluminium serii 6, wyposażona w wygodne opony pneumatyczne. Całkowita waga wynosi tylko 13 kg, co ułatwia jej przenoszenie wszędzie tam, gdzie chcesz.Duży wyświetlacz LED daje Ci szybki przegląd Twojej prędkości, przebiegu oraz poziomu naładowania baterii hulajnogi elektrycznej. Możesz podłączyć swoją Hulajnogę Elektryczną Mi 3 do aplikacji Mi Home i aktywować ją oraz śledzić swoją prędkość i poziom baterii bezpośrednio na smartfonie. Hulajnoga jest kompatybilna z systemami Android i iOS.',NULL,'xiaomi-mi-electric-scooter-3-nordic-edition-black-20-km-t',NULL,NULL,NULL,'Xiaomi Mi Electric Scooter 3 Nordic Edition Black (20 km/t)',NULL,NULL,NULL,NULL),
