('810','1','1','Seria Zing to elektryczne hulajnogi, które Segway zaprojektował specjalnie dla dzieci. Zing C8 został zaprojektowany jako zabawka dla najmłodszych i jest wyposażony w trzy ustawienia biegów, pozwalając Zing A6 poruszać się z prędkością 8, 10 i 12km/h z zasięgiem do 5km/ 3.1 mil.Zing A6 waży tylko 4,6 kg. Bateria znajduje się w podnóżku, co sprawia, że Zing A6 ma nisko położony środek ciężkości i ułatwia kierowanie hulajnogą. Zing A6 jest wyposażony w mechaniczny hamulec nożny - wystarczy nadepnąć na tylny błotnik. Tylny błotnik służy również do zmiany ustawienia biegów (tylko w pozycji stacjonarnej).Dodatkowym zabezpieczeniem jest antypoślizgowy podnóżek i antypoślizgowe koła. Zing A6 wyposażony jest w nastrojowe oświetlenie ambientowe po bokach podnóżka i w przednim kole. BMS (system zarządzania baterią) zapewnia, że cała moc baterii jest wykorzystywana i zapobiega przegrzaniu, zwarciu, przeładowaniu i nadmiernemu rozładowaniu. Wskaźnik baterii zacznie migać czerwonym światłem, gdy pozostanie mniej niż 10% mocy baterii.Zalecany wiek 6-10 latMaks. prędkość 12km/h / 7.5mphTypowy zasięg Do 5km / 3.1 milMaks. kąt wznoszenia 7%.Maks. waga kierowcy 40kgSkładany NieŚwiatła Światła nastrojowe po bokachTryby jazdy 3 biegi: 8 / 10 / 12 km/hCzas ładowania 3 godzinyMoc wyjściowa Nominalnie 50WBateria 27Wh / 2500mAhOpony Przód: 6\" / tył: 5\" pełna gumaHamulce Mechaniczne (stopień na tylnym błotniku)Waga 4.6kgDzwonek NieTeren do jazdy Asfalt, płaska nawierzchniaIP-rating IPX4**Klasyfikacja IPX4 oznacza, że KickScooter jest dobrze chroniony przeddobrze chroniony przed bryzgami wody, ale nie jest całkowicie wodoodporny.Należy unikać jazdy przez kałuże deszczowe.',NULL,'segway-ninebot-hulajnoga-kickscooter-zing-a6-czarno-zielona',NULL,NULL,NULL,'Segway Ninebot Hulajnoga Kickscooter Zing A6 Czarno-Zielona',NULL,NULL,NULL,NULL),
