('813','1','1','Seria Zing to elektryczne hulajnogi, które Segway zaprojektował specjalnie dla dzieci. Mimo, że Zing C20 został zaprojektowany jako zabawka, a nie do jazdy po mieście, SegwayNinebot nie poszedł na kompromis w kwestii jakości - wręcz przeciwnie, priorytetem było bezpieczeństwo.Dlatego maksymalna prędkość została ograniczona do 16 km/h, a hulajnoga ma zasięg 20 km. Zing C20 waży zaledwie 10 kg i można go łatwo złożyć jedną ręką. Akumulator znajduje się w podnóżku, co sprawia, że Zing C20 ma nisko położony środek ciężkości i ułatwia kierowanie hulajnogą. Zing C20 wyposażony jest w tradycyjny hamulec ręczny, który steruje tylnym kołem. Dodatkowe funkcje bezpieczeństwa to antypoślizgowa podnóżka i antypoślizgowe kółka oraz dzwonek. Dla tych, którzy dopiero zaczynają, Zing C20 jest wyposażony w ustawienie SAFE, które ogranicza prędkość do 10 km/h. Osoby z większym doświadczeniem mogą skorzystać z inteligentnej funkcji CRUISE CONTROL, a ustawienie TURBO oznacza, że nie trzeba ręcznie ruszać, aby ruszyć z miejsca. System BMS (system zarządzania akumulatorem) zapewnia wykorzystanie całej mocy akumulatora i zapobiega przegrzaniu, zwarciu, przeładowaniu i nadmiernemu rozładowaniu. Wskaźnik baterii zacznie migać czerwonym światłem, gdy zostanie mniej niż 10% energii w baterii.Zalecany wiek 10+Maks. prędkość 16km/h / 9.9mphTypowy zasięg Do 20km / 12.4 milMaks. kąt wznoszenia 7%.Maks. waga kierowcy 50kgSkładanie TakŚwiatła Światła otoczenia na spodzieTryby jazdy Turbo / Tempo / BezpiecznyCzas ładowania 5 godzinMoc wyjściowa Nominalnie 150WBateria 108Wh / 5000mAhOpony 7\" pełna guma syntetycznaHamulce Hamulec ręczny dla tylnego kołaWaga 10kgDzwonek TakTeren, po którym można się poruszać Asfalt, płaska nawierzchniaStopień ochrony IP IPX4**Klasyfikacja IPX4 oznacza, że KickScooter jest dobrze chroniony przed bryzgami wody, ale nie jest całkowicie wodoodporny.Należy unikać jazdy przez kałuże deszczowe.',NULL,'segway-ninebot-by-segway-hulajnoga-elektryczna-zing-c20-cie