('1053','1','1','HORTUS suspended, infrared patio heater with a futuristic design - perfect to mount above the table in the covered patio or the conservatory. 80 % of the energy in this UFO model is converted into heat and provides plenty of heat to everyone seated around the table. The patio heater has 2000 W, infrared halogen tubes with a lifespan of minimum 5000 hours. It also has LED lights, a soft touch power button and a remote control. The IP classification of IP54 means that the heater is approved to use in wet rooms and outdoors, since the product is tested for being dust- and waterproof.Specifications: • Model: 211-315 • Type: Hanging model • Accessories: Remote control • Dimensions: Ø: 45 cm, mounted minimum 180 cm above ground • Materials: Aluminium • Tubes: Infrared halogen, short waves • Effect level: 2000 W • Power: 230 V - 50 Hz - incl. 180 cm cable • IP classification: IP45 • Approved according to: CE, LVD &amp; EMC • Area of effect: Ø5 meters• Start-up time for full effect: 2 seconds • Energy utilization: ca. 80% • Cost of use/hour: ca. 4.40 DKK • CO2 emissions/hour: ca. 1 kg • Function time: ca. 5000 hours • Use: Outdoors and indoors',NULL,'hortus-patio-heater-ufo-hanging-model-2000-w',NULL,NULL,NULL,'HORTUS Patio heater UFO hanging model 2000 W',NULL,NULL,NULL,NULL),
('1054','1','1','80% energii w tym ogrzewaczu patio HORTUS model \"UFO\" na podłogę jest przekształcana w ciepło i zapewnia dużo ciepła dla każdego siedzącego przy stole. Infraredowe rurki halogenowe mają trzy poziomy mocy; 800 W, 1300 W i 2100 W, z minimalnym czasem życia wynoszącym 5000 godzin. Ogrzewacz patio ma wbudowane światła LED oraz przycisk z miękkim dotykiem. Posiada również funkcję timera, dzięki której można ustawić automatyczne wyłączanie się w trzech przedziałach czasowych: 30/60/90 minut. Z pilotem.Specyfikacje: • Model: 211-379 • Typ: Model na podłogę • Wymiary: H:193 cm - Ø :55 cm • Materiał : Czarno powlekany aluminium • Rura : Podczerwień , rura halogenowa , fale krótkie • Efekt :800 /1200 /2100W • Zasilanie :230V -50Hz • Klasa IP :IP45 • Zatwierdzony według norm CE,LVD &amp; EMC.&lt; br/&gt;Obszar działania:&lt; br/&gt;6-8 m&lt; br/&gt;Czas rozruchu do pełnej mocy:&lt; br/&gt;2 sekundy&lt; br/&gt;Wykorzystanie energii:&lt; br /&gt;ok .80 %&lt; br /&gt;Koszt użytkowania/godzina:&lt; br /&gt;ok. 1,76 - 4,62 DKK&lt; br /&gt;Emisja CO2/godzina:&lt; br /&gt;ok. 1 kg&lt; br/&gt;Czas funkcjonowania: około 5000 godzinUżytkowanie: wewnątrz i na zewnątrz\'',NULL,'hortus-patio-heater-ufo-floor-model-2000-w',NULL,NULL,NULL,'HORTUS Patio heater UFO floor model 2000 W',NULL,NULL,NULL,NULL),
('1055','1','1','Hortus Patio heater, model podłogowy 900/1200/2100 Watt Smart, elektryczny grzejnik na patio o pięknym designie z regulowaną wysokością. Idealny do umieszczenia obok stołu, aby emitować wygodną wysokość w późne letnie wieczory. Skuteczne ogrzewanie, tanie w użytkowaniu, bezobsługowe i można go używać zarówno wewnątrz jak i na zewnątrz. Ogrzewacz halogenowy podczerwieni Ogrzewacz halogenowy podczerwieni ogrzewa zarówno powietrze jak i powierzchnie dotknięte promieniami podczerwonymi. Część energii jest więc wykorzystywana do ogrzania powietrza, które może być usuwane przez wiatr. Ten typ grzejnika osiąga pełny efekt po około 5 sekundach i jest stosunkowo tani w zakupie. Wydajność energetyczna wynosi 80%. Emituje ciepłe białe światło.Rura halogenowa podczerwieniowa w elektrycznym grzejniku na patio ma lepsze wykorzystanie energii niż nagrzewnica gazowa lub poprzednie modele elektrycznych grzejników na patio . Elektryczne grzejniki ogrodowe emitują około 1/3 tyle CO² co nagrzewnica gazowa . Zużycie na godzinę wynosi tylko około 0,5 EUR , a dla nagrzewnic gazowych wynosi 1,5-2 EUR. 1 x Ogrzewacz na patio, 1 x Kabel Specyfikacje: • Projekt/Marka: Hortus • Kolor światła: Ciepłe białe światło • Materiał: Aluminium, wszystkie rury wykonane są z kwarcu (szkło odpornościowe na ciepło) • Funkcja włączania/wyłączania :3 wybory efektów • Odporność na warunki atmosferyczne : Zatwierdzone IP44 • Konserwacja : Bezobsługowy • Umiejscowienie : Płaska i stabilna powierzchnia • Użytkowanie : Wewnątrz i na zewnątrz • Efekt: 900/1200/2100 watów.• Wydajność energetyczna:koszt godzinny to tylko 0,5 EURźródło zasilania:elektryczne230 VDługość kabla:180 cmWydajność energetyczna:',NULL,'hortus-patio-heater-floor-model-2100-w',NULL,NULL,NULL,'HORTUS Patio heater floor model 2100 W',NULL,NULL,NULL,NULL),
