('1072','1','1','Model HORTUS pod stołem, przeznaczony do umieszczenia pod ogrodowym stołem, jest idealny do zapewnienia dobrego ciepła; dzięki temu można cieszyć się miłymi letnimi wieczorami czując się ciepło i wygodnie. Ten model grzejnika na patio HORTUS pod stołem rozprzestrzenia ciepło w 360 stopniach za pomocą technologii ultra niskiego połysku podczerwieni. Grzejnik na patio musi być po prostu podłączony do zasilania, a następnie jest gotowy do użycia. Model można łatwo przemieszczać, o ile istnieje dostęp do gniazdka elektrycznego.Dno i góra wykonane są z malowanej proszkowo stali, a czarna rura z aluminium. Istnieje wbudowana ochrona przed przewróceniem, co oznacza, że ​​zasilanie zostaje przerwane w przypadku przewrócenia grzejnika na patio. W momencie uniesienia grzejnika na patio zasilanie zostaje przywrócone. Pokrywa może zostać zakupiona jako dodatkowe akcesorium.Specyfikacje:Model: Infraredowy grzejnik na patio model pod stołem z rurą węglowąMateriały: Aluminium i malowana proszkowo stalPoziom efektu: 1200W Czas uruchamiania: Osiąga pełną moc w ciągu 15 sekundZasięg: 4-5 m2Wymiary: Wysokość: 67 cm, Ø20 cmKlasa IP: IP55Zatwierdzony zgodnie z normami CE, LVD i EMC',NULL,'hortus-patio-heater-under-table-model-1200-w-cb-ulg-black',NULL,NULL,NULL,'HORTUS Patio heater under table model 1200 W CB ULG black',NULL,NULL,NULL,NULL),
('1073','1','1','This model is placed under a table and is perfect for ensuring a pleasent heat from below, so that you can enjoy lovely summer evenings on the patio with warm legs. This HORTUS patio heater distributes the heat 360 degrees with an infrared Golden Tube with short waves. The patio heater just needs to be connected to a power socket, and it is ready to be used. The model can easily be moved around, so that you can use it on many different places with a power socket nearby. Just connect the power and place the patio heater where you want it under the table. The bottom and top are made of stainless steel with a black tube made of aluminium. There is a buildt-in tilt-proofing, which means that the power is cut off if the heater tilts. The power is re-established when the heater is upright again. Effective Golden Tube heating Golden Tube is the newest technology for patio heaters. The tubes emit short, infrared rays that heat up the surfaces they hit. No energy is wasted on heating up air that is blown away. This way you get maximum heat from the energy used. Cheap and environmentally friendly heating of the patio The high effect and energy utilization is beneficial for both the environment and your wallet, since the cost of use per hour starts at just 1.90 DKK and does not go above 4.35 DKK. The low CO2 emissions puts a minimal burden on the environment compared to a free-standing gas heater that pollutes three times as much.Specifications:• Model: 211-370• Type: Under table model• Dimensions: H: 65 cm - Ø: 20 cm• Materials: Steel, aluminium and plastic• Tubes: Infrared, Golden Tube with short waves• Effect level: 1200 W• Power: 230 V - 50 Hz - incl. 180 cm cable• IP classification: IP55• Approved according to: CE, LVD &amp; EMC• Area of effect: 3-4 m2 - 4-6 people• Start-up time for full effect: 2 seconds• Energy utilization: ca. 92 %• Cost of use/hour: ca. 2.64 DKK• CO2 emissions/hour: ca. 1 kg• Function time: ca. 7000 hours• Use: Indoors and outdoors',NULL,'hortus-patio-heater-under-table-1200-w',NULL,NULL,NULL,'HORTUS Patio heater under table 1200 W',NULL,NULL,NULL,NULL),
