('1081','1','1','50°C do 630°C, 2000W. Model profesjonalny dla wszystkich rodzajów zadań. Cyfrowy wyświetlacz LCD w profesjonalnym pistolecie grzewczym Furno 750 zapewnia precyzyjną kontrolę temperatury między 50 a 630 °C. Dlatego też pistolet grzewczy może być używany do wszelkiego rodzaju projektów i jest prawdziwie uniwersalnym modelem. Kolejną specjalną cechą Furno 750 jest to, że jest to inteligentny pistolet, ponieważ wyświetlacz ma funkcję zapisywania ostatnio użytych ustawień. Ponadto, pistolet grzewczy ma sześć różnych ustawień wentylacji i dodatkowy tryb chłodzenia, który przedłuża życie elementów grzejnych.Czujnik ochrony termicznej regulujący ciepło zapewnia dodatkowe bezpieczeństwo.Tarcza termiczna ze spacery po bokach zapobiega kontaktowi między gorącą końcówką a powierzchnią obiektów poddawanych obróbce.Tarcza termiczna może zostać usunięta w przypadku konieczności dotarcia do trudno dostępnych miejsc.Z powodu swojej stabilnej tylnej powierzchni i wbudowanego uchwytu w etui można korzystać z obu rąk podczas pracy z nim.Po zakończeniu pracy Furno 750 można zawiesić na praktycznym wieszaku, aż będzie potrzebny ponownie.Pistolet grzewczy i kompleksowe akcesoria dołączone są w solidnym i kompaktowym etui dla łatwego przechowywania.',NULL,'wagner-furno-750',NULL,NULL,NULL,'Wagner Furno 750',NULL,NULL,NULL,NULL),
