('1084','1','1','60°C do 600°C, 2000W, Wszechstronny model dla doświadczonego majsterkowicza. Furno 500 to profesjonalna elektroniczna pistoletowa nagrzewnica z graficznym wyświetlaczem LED. Zawsze masz przegląd nad 12 ustawieniami temperatury od 60 °C do 600 °C i dzięki nim można rozwiązać wiele różnych zadań. Najlepsze jest to, że Furno 500 to inteligentna nagrzewnica: dzięki funkcji zapisywania ostatnio używanych ustawień można je zapisać na późniejsze użytkowanie. Żywotność elementów grzejnych przedłuża wentylator o dwóch ustawieniach wentylacji i trybie chłodzenia. Aby zwiększyć bezpieczeństwo, pistolet termiczny ma czujnik ochrony termicznej regulujący ciepło. Tarcza cieplna ze spacjami po bokach zapobiega kontaktowi między gorącą końcówką a powierzchnią obiektów poddawanych obróbce . Jednakże, jeśli istnieje potrzeba dotarcia do trudno dostępnych wąskich przestrzeni , tę osłonę można również usunąć . Ze względu na swoją stabilną tylną powierzchnię możesz pracować oboma rękami . Dołączono płaski dyszę dla delikatnych powierzchni (np., szkło) oraz dyszę centralizującą do usuwania farby . Po zakończeniu pracy Furno 500 można zawiesić na praktycznym uchwycie, aż będzie potrzebny ponownie.',NULL,'wagner-furno-500',NULL,NULL,NULL,'Wagner Furno 500',NULL,NULL,NULL,NULL),
