('1100','1','1','Jedno dotknięcie poziomowaniaWyposażony w samoinicjujący system automatycznego poziomowania Anycubic LeviQ. Inteligentna i precyzyjna kalibracja 25 punktów oraz algorytm sprzętowy do automatycznego kompensowania nierówności podłoża, dzięki czemu poziomowanie nigdy nie było takie proste.Zintegrowany ekstruder dla precyzyjnego wytłaczania filamentuEkstruder jest zintegrowany z gorącą końcówką, co ułatwia wymianę filamentu przy niższej częstotliwości awarii. Ponadto zintegrowany ekstruder może dostarczać filament bardziej efektywnie i precyzyjnie.Klejąca platforma ze stali sprężynowej PEI dla łatwego usuwaniaPlatforma drukująca wykonana jest ze sprężystej stali magnetycznej, która jest odporna na zużycie, mniej krucha i giętka. Gotowe miniaturki można szybko usunąć przez lekkie wygięcie platformy budowlanej. Magnetyczny design ułatwia instalację i usuwanie.10 minut łatwej konfiguracji5-modularny projekt umożliwia skonfigurowanie drukarki w ciągu 10 minut, co czyni KOBRA Neo dobrym wyborem dla początkującej drukarki FDM 3D.Wysoka prędkość drukuAnycubic KOBRA Neo drukuje z typową prędkością 60mm/s i osiąga maksymalną wartość 100mm/s, co pozwala przyspieszyć czasy druku 3D bez utraty jakości.Większy wymiar tworzeniaW porównaniu do poprzedniej generacji Anycubic Mega S, Anycubic KOBRA Neo ma wzrost objętości wydruku o 34,4% do 12,1 litra. Wielkość wydruku to 220*220*250 mm, co odpowiada rozmiarowi piłki piłkarskiej standardowego rozmiaru.',NULL,'anycubic-kobra-neo-drukarka-3d',NULL,NULL,NULL,'ANYCUBIC Kobra NEO - Drukarka 3D',NULL,NULL,NULL,NULL),
('1101','1','1','Ender 3 S1 Pro to nowa i ulepszona wersja bardzo udanego Endera 3 S1. Wyposażony w nowo opracowany bezpośredni podwójny ekstruder zębatkowy.Nowy ekstruder Sprite ma podwójne koła zębate, co oznacza, że będzie pchał filament siłą, a także jest kompatybilny z elastycznymi rodzajami filamentu takimi jak TPU, które normalnie są bardzo trudne do drukowania - ale nie dla sprite\'a!16-punktowe automatyczne wykrywanie poziomu łóżka CR-Touch usunie domysły dotyczące próby wyrównania łóżka. Łatwy w użyciu i zawsze zapewni idealną powierzchnię druku na poziomie.32-bitowa cicha płyta główna sprawi, że drukarka będzie działać płynnie i cicho. Kolejnym świetnym dodatkiem do tej drukarki jest nowy wysokotemperaturowy dysza do materiałów drukarskich osiągających temperaturę nawet 300°.Standardowo S1-Pro wyposażony jest w elastyczną magnetyczną stalową płytę budowlaną z powierzchnią PEI. To pomoże modelom lepiej się trzymać, jednocześnie ułatwiając ich usuwanie.Dodatkowe akcesoria takie jak grawer laserowy, chłodzony cieczą radiator i pudełko wi-fi będą dostępne. Podsumowując, S1 Pro przewyższa większość drukarek na rynku w tej cenie i jest prawdziwą okazją.',NULL,'creality-ender-3-s1-pro-drukarka-3d',NULL,NULL,NULL,'CREALITY Ender 3 S1 Pro - Drukarka 3D',NULL,NULL,NULL,NULL),
