('1103','1','1','ANYCUBIC PHOTON M3 Zupełnie nowa seria Anycubic M3 to nowy standard wśród drukarek SLA. Kultowa seria Photon była pionierem w całej historii druku SLA, a wersje M3 jeszcze bardziej przesuwają granice. Anycubic M3 wyposażony jest w 7,6\" ekran 4K Mono, który zapewni Ci ekstremalne szczegóły na nawet najmniejszym wydruku.Ekran jest chroniony przez folię ochronną Anycubic, więc krople żywicy itp. nie zabiją ekranu. Prędkość druku wzrosła i Photon M3 jest teraz w stanie drukować z prędkością 50mm/h. To pozwoli Ci wydrukować figurkę o wysokości 12cm w zaledwie 2½ godziny, czyli o 30 minut szybciej niż konkurencja. Photon M3 jest najmniejszą drukarką z serii M3, jednak nadal posiada pole zadruku 180x163,9x102,4 mm, co jest wystarczające dla większości wydruków.Nowo opracowana głowica drukująca ma laserowo nacinaną powierzchnię, która umożliwia znacznie lepszą przyczepność niż w poprzednich modelach Photon.',NULL,'anycubic-photon-m3-drukarka-3d-',NULL,NULL,NULL,'ANYCUBIC PHOTON M3 - Drukarka 3D -',NULL,NULL,NULL,NULL),
('1104','1','1','Nowa seria Anycubic M3 to nowy standard w drukarkach SLA. Ikoniczna seria Photon była pionierem we wszystkich dziejach druku SLA, a wersje M3 posuwają granice jeszcze dalej. Anycubic M3 Plus ma ekran 6K Mono o przekątnej 9,25 cala, który zapewni Ci skrajnie szczegółowe detale nawet na najmniejszych wydrukach. Ekran jest chroniony folią ochronną Anycubic, dzięki czemu krople żywicy itp. nie uszkodzą go. Prędkość druku wzrosła i Photon M3 Plus teraz może drukować z prędkością 100 mm/h. Pozwoli to na wydrukowanie figurki o wysokości 12 cm w zaledwie 1,2 godziny, co jest o 1,8 godziny szybciej niż u konkurentów.Z Photonem M3 Plus nigdy nie musisz martwić się brakiem Żywicy - jest wyposażony w pompę do Żywicy umożliwiającą bezpośrednie pobieranie z butelki do kadzi żywicznej.Photon M3 Plus to średniej wielkości drukarka z serii M3 - ma obszar roboczy wynoszący 245x197x122 mm , co odpowiada Mono X / Mono X6K.Nowo opracowana głowica posiada powierzchnię cięcia laserowego pozwalającą na znacznie lepsze przyleganie niż poprzednie modele Photon. Photon M3 Plus obsługuje Anycubic Cloud, dzięki czemu możesz kontrolować swoją drukarkę za pomocą aplikacji. Oznacza to również, że możesz monitorować ją podczas druku.',NULL,'anycubic-photon-m3-plus-drukarka-3d',NULL,NULL,NULL,'ANYCUBIC PHOTON M3 PLUS - Drukarka 3D',NULL,NULL,NULL,NULL),
