('1112','1','1','ANYCUBIC MEGA XAnycubic zgromadził silny zespół badawczo-rozwojowy z różnych krajów. Prostsza, mądrzejsza i bardziej praktyczna filozofia została zastosowana do stworzenia wysokiej jakości drukarek 3D, aby spełnić potrzeby zawodowe i życia codziennego.Naszym celem jest \"Najpopularniejsza marka drukarek 3D\" w oparciu o wysokiej jakości produkty, szybką obsługę i innowacyjne funkcje, aby poprawić jakość życia i przyczynić się do rozwoju społecznego.Modułowa konstrukcjaBez kłopotów z montażem, rozpocznij pracę szybko.Platforma UltrabaseSilne przyleganie, łatwe usuwanie, wielokrotne użycie bez utraty wydajności.Potężny ekstruderZapewnia lepsze doświadczenie w drukowaniu, kompatybilny z TPUBezproblemowe poziomowanieDuże pokrętło poziomowania jest znacznie wygodniejsze do trzymania, znacznie oszczędza wysiłek.',NULL,'anycubic-mega-x-drukarka-3d-',NULL,NULL,NULL,'ANYCUBIC Mega X - Drukarka 3D -',NULL,NULL,NULL,NULL),
