('1120','1','1','Utwardzanie 360Automatycznie obracająca się o 360° platforma utwardzania, wyposażona w światło paskowe w kształcie litery L i lustrzaną naklejkę odblaskową, umożliwia maszynie rzeczywiste, dokładne utwardzanie.Unowocześnione kulki lampy UVDodane z soczewką optyczną, źródło światła UV może osiągnąć bardziej równomierne napromieniowanie i dokładne utwardzenie.Bardziej wydajne mycieWiele metod mycia może przynieść bardziej elastyczne czyszczenie modelu i uniknąć kontaktu z żywicą. Mycie w koszu i czyszczenie w zawieszeniuSilniejsza moc czyszczeniaSuper-duży wir czyszczący pozwala płynowi oczyścić każdą część modelu i wspomaga czyszczenie modelu z żywicy.Bezpieczniejsze użytkowanieAutomatyczna pauza po zdjęciu pokrywy W trybie utwardzania, maszyna zatrzymuje się po zdjęciu pokrywy, aby zapobiec szkodliwemu działaniu promieni UV na ludzkie ciało.Osłona anty-UVZintegrowana osłona anty-UV jest w stanie zablokować 99,95% światła UV o długości fali 405nm.Łatwiejsze przełączanie trybówWybór czasu 1-60min zapewnia więcej możliwości wyboru dla mycia i utwardzania.Zamknięte wiadro do myciaWiadro do mycia może pomieścić modele o większych rozmiarach i jest kompatybilne ze wszystkimi drukarkami żywicznymi LCD o przekątnej 8,9 cala i mniejszej dostępnymi na rynku.Po oczyszczeniu i utwardzeniuWłaściwości materiałowe żywicy ulegają znacznej poprawie po jej oczyszczeniu i utwardzeniu.',NULL,'anycubic-wash-cure-plus-drukarka-3d-',NULL,NULL,NULL,'ANYCUBIC Wash & Cure Plus - Drukarka 3D -',NULL,NULL,NULL,NULL),
('1121','1','1','FlashForge Adventurer 3 Pro to wysokiej jakości drukarka 3D z zamkniętą komorą drukowania i automatycznym podawaniem filamentu. Kolorowy ekran dotykowy ułatwia korzystanie z drukarki i wybieranie różnych opcji druku. Ta drukarka 3D jest łatwa do podłączenia do komputera za pomocą kabla USB lub można zdalnie kontrolować urządzenie za pomocą wifi.Wszechstronne funkcje ułatwiają użytkowanieMaszyna szybko się nagrzewa do temperatury 200°C, dzięki czemu można natychmiast rozpocząć drukowanie i wygodnie sprawdzić, czy maszyna czysto się drukuje. Usuwana dysza jest łatwa do wymiany lub serwisowania w razie potrzeby. Chmura 3D oraz Wi-Fi umożliwiają wszechstronne modele wydruków oraz zdalne drukowanie. Dzięki wbudowanej kamerze możesz łatwo monitorować zdalne drukowanie. Automatyczne podawanie filamentu również sprawia, że całe doświadczenie użytkownika jest bardziej przyjemne.Precyzja i stabilność dla procesu drukuPodgrzewana platforma zapewnia zarówno precyzję jak i stabilność procesu druku. Ciepło przylega obiekt na platformę i zapobiega jego przesuwaniu się w trakcie procesu. Wytrzymała rączka i ramka utrzymują drukarkę w stabilnej pozycji we wszystkich sytuacjach.Wszechstronne zastosowanie materiałówDrukarka dobrze działa z różnymi materiałami. Adventurer 3 Pro obsługuje materiały PLA, ABS, PC, PETG, PLA-CF oraz PETG-CF. Zamknięta klapa utrzymuje warunki stabilne i jest szczególnie korzystna dla materiałów, które mają tendencję do wyginania się takich jak ABS.',NULL,'flashforge-adventurer-3-pro-drukarka-3d',NULL,NULL,NULL,'FlashForge Adventurer 3 Pro - Drukarka 3D',NULL,NULL,NULL,NULL),
